    "coef <- c(0.1, .4, -0.5, -0.1)\n",
    "\n",
    "true_f <- function(t)\n",
    "{\n",
    "    #poly(t , degree = 4, raw = TRUE)%*%coef  # works well\n",
    "    exp(sin(pi*t)+ t^2)\n",
    "    \n",
    "    #sin(3*t) # works well\n",
    "    \n",
    "    #sin(3*t) + exp(x)  # works well\n",
    "    \n",
    "    #sin(4*t)  # very poor, perhaps with more layers and data it can be predicted?\n",
    "    \n",
    "}\n"
   ]
