    "# Define the model\n",
    "polynomial_model <- keras_model_sequential() %>%\n",
    "                      layer_dense(units = 20, activation = 'sigmoid',\n",
    "                                  input_shape = 1) %>%\n",
    "                      layer_dense(units = 10, activation = 'sigmoid') %>%\n",
    "                      layer_dense(units = 5, activation = 'sigmoid') %>%  \n",
    "                      layer_dense(units = 1, activation = 'linear')\n",
    "\n",
    "\n",
    "# set up optimizer\n",
    "#myoptimizer <- optimizer_sgd(learning_rate = 0.01)\n",
    "myoptimizer <- optimizer_adam(learning_rate = 0.01)\n",
    "\n",
    "\n",
    "# Compile the model\n",
    "polynomial_model %>% compile(optimizer = myoptimizer,\n",
    "                             loss = 'mean_squared_error')\n",
    "                            \n",
    "#print(polynomial_model)"
   ]
