   "source": [
    "# Train and validate the model\n",
    "# Validation loss and accuracy at the end of each epoch\n",
    "\n",
    "val_x <- runif(n, -1, 1)\n",
    "val_y <- true_f(val_x) \n",
    "\n",
    "t1 <- Sys.time()\n",
    "fitted_network <- polynomial_model %>% \n",
    "                        fit(x, y,\n",
    "                            epochs = 50,\n",
    "                            batch_size = 32,\n",
    "                            validation_data = list(val_x, val_y))\n",
    "\n",
    "plot(fitted_network)\n",
    "\n",
    "Sys.time() - t1\n",
    "\n",
    "## NOTES:\n",
    "\n",
    "# If unspecified, batch_size will default to 32 - Keras dicumentation\n",
    "# 'batch' is the number of samples per gradient update\n",
    "# An 'epoch' is an iteration over the entire dataset.\n",
    "# Ref : https://keras.io/api/models/model_training_apis/\n",
    "\n",
    "#1. n = 1000, batch not specified (default to 32), epoch = 100: not very good estimates\n",
    "#2. n = 1000, batch = 50, epoch = 200:not good\n",
    "#3. n = 2000, batch = 50, epoch = 200:not good\n",
    "#4. n = 1000, batch = 100, epoch = 100: not good\n",
    "#5. n = 2000, batch = 100, epoch = 100: not good\n",
    "#6. n = 3000, batch = 32, epoch = 100: not good\n",
    "#7. n = 3000, batch = 50, epoch = 100: very good\n",
    "#8. n = 3000, batch = 50, epoch = 50: very good  ---> WINNER\n",
    "\n",
    "# It shows, we just need LOTS of data, \n",
    "# No need of large batch sizes or long epochs\n",
    "# few samples per batch and few epochs seems to be doing the job just fine\n",
    "# DATA HUNGRY!!\n",
    "\n",
    "\n",
    "\n"
   ]
