   "source": [
    "# Make predictions\n",
    "x_new <- seq(-2, 2, by = 0.01)\n",
    "y_pred <- polynomial_model %>% \n",
    "                     predict(x_new)\n",
    "\n",
    "# Plot the predictions from the Network model\n",
    "plot(x, y,\n",
    "     col = 'blue',\n",
    "     main = 'Polynomial Regression using a Network model')  # original curve\n",
    "\n",
    "lines(x_new, y_pred, col = \"red\", lwd = 2)  # Network model prediction\n",
    "\n",
    "#classical model\n",
    "classical <- lm(y ~ poly(x, degree = 3))\n",
    "\n",
    "classical_predictions <- predict(classical,\n",
    "                                 data.frame(x = x_new))\n",
    "\n",
    "lines(x_new,\n",
    "      classical_predictions,\n",
    "      col = 'green', lwd = 2 )  #Classical model prediction\n"
   ]
  },
