    "# Extract Layerwise parameters, \n",
    "# Note the input is the original input for all 3 cases\n",
    "\n",
    "layer1_model <- keras_model(inputs = polynomial_model$input,\n",
    "                            outputs = polynomial_model$layers[[1]]$output)\n",
    "\n",
    "layer2_model <- keras_model(inputs = polynomial_model$input,\n",
    "                            outputs = polynomial_model$layers[[2]]$output)\n",
    "\n",
    "layer3_model <- keras_model(inputs = polynomial_model$input,\n",
    "                            outputs = polynomial_model$layers[[3]]$output)\n",
    "\n",
    "\n",
    "layer1_output <- layer1_model %>% predict(x_new)\n",
    "layer2_output <- layer2_model %>% predict(x_new)\n",
    "layer3_output <- layer3_model %>% predict(x_new)\n",
    "\n",
    "# convert to a vector\n",
    "layer1_output <- rowSums(layer1_output)\n",
    "layer2_output <- rowSums(layer2_output)\n",
    "layer3_output <- rowSums(layer3_output)"
   ]
